import React from 'react';

class Slider extends React.Component {
    // props: value, max_tracked, max_value, min_value
    constructor(props) {
      super(props);
      this.state = {
        clickPosX: undefined, //TODO put where?
        selectedStyle: {
          backgroundColor: "blue",
          width: "0%",
          height: "20px",
        },
        bgStyle: {
          backgroundColor: "#dedede", // light gray
          width: "100%",
          height: "20px",
        },
        trackedStyle: {
          backgroundColor: "light-blue",
          width: "0%",
          height: "20px",
        },
        thumbStyle: {
          //height: "20px",
        },
      };
    }
  
    render() {
      return(
        <div style = {this.state.bgStyle}>
          <div id="Thumb" className="slidecontainer" style = {this.state.thumbStyle} onMouseDown = {this.props.handleSliderInput} onMouseUp = {this.props.handleSliderInput}>
            <p>{this.state.frameNumber}</p>
          </div>
        </div>
      );
    }
  }

  export default Slider;
